 function setPercent(gauge, percent) {
	var percentValue = percent / 100;
	var gaugeWidth = percentValue * gauge.parentNode.clientWidth;
	gauge.style.width = gaugeWidth + 'px';
}

var percent;
var increment;
var gauge;
function incrementPercent(tx, rs) {
	setPercent(gauge, percent += increment);
}

function progressComplete(tx, rs) {
	setPercent(gauge, 100);
	document.getElementById('tblGauge').style.display = 'none';
	document.getElementById('tblAddLocation').style.display = 'block';
	document.getElementById("txtcityzip").focus();
	setFocusToElement('dummyDivAddLocation', 'txtcityzip');
}

